import { useState } from "react";

function Digit({ value, enterDigit }) {
    return <button class="digit" onClick={enterDigit}>{value}</button>
}

export default function Calculator() {

    const [equation, setEquation] = useState("");

    function enterDigit({ value }) {
        setEquation({ value })
    }

    return (
        <>
            <input type="text" onChange={equation} />
            <div class="board-row">
                <Digit value={7} enterDigit={enterDigit}></Digit>
                <Digit value={8}></Digit>
                <Digit value={9}></Digit>
            </div>
            <div class="board-row">
                <Digit value={4}></Digit>
                <Digit value={5}></Digit>
                <Digit value={6}></Digit>
            </div>
            <div class="board-row">
                <Digit value={1}></Digit>
                <Digit value={2}></Digit>
                <Digit value={3}></Digit>
            </div>
        </>
    );
}
